import React from 'react'
import { View, Text } from 'react-native'

const NavBar = () => {
    return (
        <View>
            <Text style={{ color: 'white', marginTop:40, backgroundColor: 'green', flex: 2 }}>Navbar!!</Text>
        </View>
    )
}

export default NavBar
